import React from 'react';
import { styled } from '@mui/material/styles';
import TextField from '@mui/material/TextField';
import InputAdornment from '@mui/material/InputAdornment';

// List
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Checkbox from '@mui/material/Checkbox';
import IconButton from '@mui/material/IconButton';

import './feedbackSubmit.scss';

const feedbackSubmit = (props) => {
  const profName = 'Dr ABCD';
  const courseName = 'Not Maths'
  const courseCode = 'CSE123'
  const year = '2020'
  const sem = "Even"

  return (
    <div className='feedbackSubmit'>
      <div className='feedbackSideStats'>
        <h1> Course Information </h1>
        <ul>
          <li> Professor: {profName} </li>
          <li> Course: {courseName} </li>
          <li> Code: {courseCode} </li>
          <li> Year: {year} </li>
          <li> Semester: {sem} </li>
        </ul>
      </div>

      <div className='feedbackMain'>
        <h1> Feedback Submission </h1>
        <div className='feedbackInput'>
          <CssTextField
            // InputProps={{
            //   startAdornment: (
            //     <InputAdornment position="start">

            //     </InputAdornment>
            //   ),
            // }}
            id="feedback-input"
            label="FEEDBACK"
            multiline
            rows={4}
          />

          <List sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}>
            {[0, 1, 2, 3].map((value) => {
              const labelId = `checkbox-list-label-${value}`;

              return (
                <ListItem
                  key={value}
                  disablePadding
                >
                  <ListItemButton role={undefined} onClick={handleToggle(value)} dense>
                    <ListItemIcon>
                      <Checkbox
                        edge="start"
                        checked={checked.indexOf(value) !== -1}
                        tabIndex={-1}
                        disableRipple
                        inputProps={{ 'aria-labelledby': labelId }}
                      />
                    </ListItemIcon>
                    <ListItemText id={labelId} primary={`Line item ${value + 1}`} />
                  </ListItemButton>
                </ListItem>
              );
            })}
          </List>
        </div>
        <div className='hr' />
        <div className='feedbackSelection'> Some </div>
        <div className='hr' />
        <div className='feedbackFinal'> Some </div>
      </div>
    </div>
  )
}

export default feedbackSubmit;



const CssTextField = styled(TextField)({
  '& .MuiInputBase-input': {
    color: 'white',
  },
  '& label': {
    color: 'white'
  },
  '& label.Mui-focused': {
    color: 'white',
  },
  '& .MuiInput-underline:after': {
    borderBottomColor: '#ce3333',
  },
  '& .MuiOutlinedInput-root': {
    '& fieldset': {
      borderColor: 'white',
    },
    '&:hover fieldset': {
      borderColor: '#ce3333',
    },
    '&.Mui-focused fieldset': {
      borderColor: '#ce3333',
    },
  },

  "& .MuiFormLabel-root.Mui-error": {
    color: "#ffdd00 !important"
  },
  '& label.Mui-focused.Mui-error': {
    color: "white !important",
  },
  '& .MuiOutlinedInput-root.Mui-error': {
    '& fieldset': {
      borderColor: "#ffdd00 !important",
    },
    '&:hover fieldset': {
      borderColor: "#ffdd00 !important",
    },
    '&.Mui-focused fieldset': {
      borderColor: "#ffdd00 !important",
    },
  },
});
